import {
  BarChartOutlined,
  CalendarOutlined,
  // CrownOutlined,
  ClusterOutlined,
  // FrownOutlined,
  HeartOutlined,
  HomeOutlined,
  IdcardOutlined,
  StarOutlined,
  // CloudUploadOutlined,
  // UploadOutlined,
} from '@ant-design/icons';
import { APP_PREFIX_PATH } from 'configs/AppConfig'

const dashBoardNavTree = [
  {
    key: 'dashboard',
    path: `${APP_PREFIX_PATH}/journeys/dashboard`,
    title: 'Dashboard',
    icon: HomeOutlined,
    breadcrumb: false,
    submenu: []
  },
  {
    key: 'progress',
    path: `${APP_PREFIX_PATH}/journeys/progress`,
    title: 'Progress',
    icon: BarChartOutlined,
    breadcrumb: false,
    submenu: []
  },
  {
    key: 'transaction',
    path: `${APP_PREFIX_PATH}/journeys/journey-ivr/transaction`,
    title: 'Transaction',
    icon: StarOutlined,
    breadcrumb: false,
    submenu: []
  },
  {
    key: 'dailyTracker',
    path: `${APP_PREFIX_PATH}/journeys/journey-ivr/dailyTracker`,
    title: 'Daily Tracker',
    icon: CalendarOutlined,
    breadcrumb: false,
    submenu: []
  },
  {
    key: 'taskTracker',
    path: `${APP_PREFIX_PATH}/journeys/journey-ivr/taskTracker`,
    title: 'Task Tracker',
    icon: ClusterOutlined,
    breadcrumb: false,
    submenu: []
  },
  {
    key: 'userRoles',
    path: `${APP_PREFIX_PATH}/journeys/journey-ivr/userRoles`,
    title: 'Users & Roles',
    icon: IdcardOutlined,
    breadcrumb: false,
    submenu: []
  }
]

const navigationConfig = [
  ...dashBoardNavTree
]

export default navigationConfig;
